INSERT INTO forecast_points VALUES(415,15,0.050000000000000002775,0.14999999999999999444,0.010000000000000000208,'Although Hailey and Vivek are doing well in the polls I find it hard to believe that they can win against Trump. Especially since Hailey is too far from Trump and Vivek is trying too hard to be Trump 2.0','2023-10-16');
INSERT INTO forecast_points VALUES(416,10,0.2000000000000000111,0.25,0.050000000000000002775,'BTC has seen a sharp incline in price due to new ETFs being prepared. Easier availability for institutions seems like it should affect the price positively','2023-10-25');
