INSERT INTO forecast_points VALUES(419,12,0.10000000000000000555,0.34999999999999997779,0.050000000000000002775,'Turkey is stalling and time is running out, so even though it seems very likely that Sweden will join NATO at some point it seems less likely that it will happen before EOY','2023-12-05');
