INSERT INTO forecast_points VALUES(425,47,0.029999999999999998889,0.2000000000000000111,0.010000000000000000208,'Updating on Nov CPI which came in at 5.8%','2024-01-06');
INSERT INTO forecast_points VALUES(426,55,0.040000000000000000832,0.10000000000000000555,0.010000000000000000208,'Scaling seems more and more unlikely to produce AGI alone and I don''t think govs have the skill to create algorithmic progress','2024-01-06');
INSERT INTO forecast_points VALUES(427,63,0.010000000000000000208,0.050000000000000002775,0.0010000000000000000208,'Very unlikely, does not poll very well and she''s lost to Trump before','2024-01-06');
INSERT INTO forecast_points VALUES(428,110,0.5500000000000000444,0.84999999999999997779,0.2000000000000000111,'Last year, I ran 540km. Largely due to having a lot of free time in Japan, this year I''m doubling and I will not have that free time. Perhaps this is too optimistic, time will tell','2024-01-06');
INSERT INTO forecast_points VALUES(429,110,0.52000000000000001776,0.69999999999999995559,0.4000000000000000222,'I''ve not gotten the best of starts of the year, with some sickness and a trip to Åre..','2024-01-20');
INSERT INTO forecast_points VALUES(430,111,0.005000000000000000104,0.050000000000000002775,0.0010000000000000000208,'Base rate is very low. The only realistic threat is Russia and even then they have another war on their hands and there are other countries that are far more likely targets.','2024-01-20');
INSERT INTO forecast_points VALUES(431,112,0.59999999999999997779,0.8000000000000000444,0.29999999999999998889,'Needs to appreciate ~18% from current price ($42.4K), which does not seem unreasonable given current market expectations of lower rates annflation expectations. ','2024-01-20');
INSERT INTO forecast_points VALUES(432,113,0.67000000000000003996,0.8000000000000000444,0.4000000000000000222,'I''ve been reading Atomic Habits and I''ve decided that this is a habit that I want to create. Using the techniques in the book, I think this is quite likely to happen. But I''m also mindful of optimism bias.','2024-02-05');
INSERT INTO forecast_points VALUES(433,114,0.69999999999999995559,0.9000000000000000222,0.4000000000000000222,'I''ve not yet tried doing a max on benchpress, but I''m easily doing 80kg at the moment. So with another year of training, this should be fairly easy. Still, I''m taking height for potential injuries and I''m also planning to do more running than gym which may affect the plan.','2024-02-05');
INSERT INTO forecast_points VALUES(434,110,0.4000000000000000222,0.59999999999999997779,0.10000000000000000555,'Currently having a hard time balancing all the activities that I want to do. I want to go to  the gym 2-3x per week, play football at least 2x per week and then run 3-4x per week on top. This is not feasible and I''m not doing well prioritizing running at the moment. I expect these struggles to continue even though I''ve decided to prioritize running over the gym.','2024-02-05');
INSERT INTO forecast_points VALUES(435,122,0.29999999999999998889,0.69999999999999995559,0.10000000000000000555,'I would really like to do this, but I think it is unlikely given that Nellie does not seem to be as enthusiastic as I am on this. There''s a possibility that I do it myself, but I think it is a small chance. The probability mainly comes from me expecting that there''s some chance that I can talk Nellie into doing it.','2024-02-05');
INSERT INTO forecast_points VALUES(436,137,0.6500000000000000222,0.8000000000000000444,0.29999999999999998889,'I might regret this later, but we are doing well in early preseason games against other div 4 teams. This will be our 2nd season with a fairly new team, I expect that we will play even better than last year. Thus the high probability.','2024-02-05');
INSERT INTO forecast_points VALUES(437,133,0.8000000000000000444,0.9000000000000000222,0.59999999999999997779,'I think I''m currently not able to do this, though I haven''t tried. Given that I''m planning to increase both interval training and longer run mileage, I think this is likely to happen. ','2024-02-05');
INSERT INTO forecast_points VALUES(438,138,0.25,0.10000000000000000555,0.5,'I''m not a goal scorer and I''m pretty sure that I''ve never scored more than 1 goal in a season. The base rate is thus low, but at the same time it looks like I''ll be playing more of an offensive role this year. ','2024-02-05');
INSERT INTO forecast_points VALUES(439,140,0.84999999999999997779,0.94999999999999995559,0.6500000000000000222,'We have been a couple for more than 7 years now. I think this is overdue and Nellie has been explicitly telling me that she wants me to propose. I''ll just try to look for a good moment. The reason it is not higher despite me wanting to do it is that I know that I have a tendency to procrastinate on these types of decisions.','2024-02-05');
INSERT INTO forecast_points VALUES(440,139,0.34999999999999997779,0.6500000000000000222,0.10000000000000000555,'I would like to travel this year, but I''m in an uncertain situation at the moment and thus I think it is unlikely that it will happen. We are planning one trip outside of Sweden so far, but that won''t last more than 10 days.','2024-02-05');
INSERT INTO forecast_points VALUES(441,13,0.97999999999999998223,0.99899999999999999911,0.84999999999999997779,'Trump is doing really well in the primaries and it looks like Nikki Haley, his only competition, does not have much gas left in the tank.','2024-02-05');
INSERT INTO forecast_points VALUES(442,30,0.48999999999999999111,0.59999999999999997779,0.4000000000000000222,'Trumps looks like a good candidate against Biden and Biden''s approval rate does not look good. On the other hand, the economy is going strong which favors Biden.','2024-02-05');
INSERT INTO forecast_points VALUES(443,21,0.050000000000000002775,0.10000000000000000555,0.010000000000000000208,'I think I updated a bit too much on previous news. Now time has passed and I think it is warranted to update downwards.','2024-02-05');
INSERT INTO forecast_points VALUES(444,142,0.94999999999999995559,0.98999999999999999111,0.8000000000000000444,'Max was unstoppable last season. Based on gap between RB and the rest of the field at the end of last season, there is no reason to believe thatyone will be able to compete for the title. I am however expecting less of a complete blowout for MV though. ','2024-02-11');
INSERT INTO forecast_points VALUES(445,143,0.75,0.9000000000000000222,0.5,'No season of F1 has ended with only one team winning all GPs, so the base rate of this not happening is low. It was close in the last two seasons, which is why I''m still going lower than base rate would suggest.','2024-02-11');
INSERT INTO forecast_points VALUES(446,144,0.34999999999999997779,0.5500000000000000444,0.10000000000000000555,'Perez did not perform well in the last 3/4 of the last F1 season. Perhaps only winning once will be enough to outscore Perez. Still, RB is a great car with a big gap to the other teams and I expect them to win most races and it is not unlikely that Perez wins at least one or two GPs.','2024-02-11');
INSERT INTO forecast_points VALUES(447,145,0.080000000000000001665,0.010000000000000000208,0.25,'With 24 GPs this coming season, it''s going to take a lot for Max to win them all. Especially with tracks like Singapore, where RB have been weak for a couple of seasons now.','2024-02-11');
INSERT INTO forecast_points VALUES(448,146,0.4500000000000000111,0.75,0.2000000000000000111,'This is a difficult forecast to make, we saw very little of Ricciardo last year, but what we saw did not indicate to me that he will with high probability outscore Tsunoda. This also depends so much on how good their car is this year, with a car that''s max capable of scoring 9-10th, a chance 4-6th placement will mean a lot for this forecast. ','2024-02-11');
INSERT INTO forecast_points VALUES(449,147,0.2000000000000000111,0.4000000000000000222,0.10000000000000000555,'Based on last year, and their track record in some "easy" games, I''m pessimistic. However, their recent win against Liverpool made me update quite a lot.','2024-02-11');
INSERT INTO forecast_points VALUES(450,117,0.4500000000000000111,0.51000000000000000888,0.4000000000000000222,'Biden has poor approval ratings and I''m starting to believe that he''ll lose against Trump if they are the candidates. An additional downwards update on potential health concerns. ','2024-02-11');
INSERT INTO forecast_points VALUES(451,118,0.48999999999999999111,0.53000000000000002664,0.41999999999999998445,'Trump is going strong in Republican primaries and Biden is looking like a weak opponent. The main risk for Trump is the strong Biden economy and the court proceedings he is in.','2024-02-11');
INSERT INTO forecast_points VALUES(452,119,0.020000000000000000416,0.050000000000000002775,0.0010000000000000000208,'Even though I see quite a few influential people liking RFK Jr., I still think he is at way to much of a disadvantage from running as an independent and also Trump is too strong among the voters that are also attracted to RFK. ','2024-02-11');
INSERT INTO forecast_points VALUES(453,128,0.75,0.9000000000000000222,0.5,'From what I understand, GPT-5 (or at least OpenAI''s next model) is being trained at the moment. I doubt it will be released before then end of US elections though, especially given that this model will be more persuasive than GPT-4. That gives little time left for release but I think it is fairly likely to happen.','2024-02-11');
INSERT INTO forecast_points VALUES(454,129,0.2000000000000000111,0.4500000000000000111,0.050000000000000002775,'This is unlikely, given RLHF towards helpfulness but there''s still ways of "jailbreaking" the models and RLHF is not perfect. The resolution criteria is also quite strict, the LLM must actively suggest harm, it cannot be a product of the user''s imagination. (and it has to be proved that the LLM suggested it, it cannot only be rumors)','2024-02-11');
INSERT INTO forecast_points VALUES(455,155,0.4000000000000000222,0.6500000000000000222,0.2000000000000000111,'Not sure what to think here, on the one hand the evidence that Q* existed at the moment of the OpenAI board turbulence is quite weak. On the other hand, OpenAI could have something and they may have started calling something Q* after the fact. ','2024-02-11');
INSERT INTO forecast_points VALUES(456,156,0.8000000000000000444,0.94999999999999995559,0.8000000000000000444,'With Gemini Advanced being released and it being close to as good as GPT-4, I think there''s a high chance of an LLM outperforming GPT-4 quite soon. Most of the probability mass comes from GPT-5 being released, but Google have also said that they are training their next model. It seems unlikely that they would train a model to be worse than GPT-4. At the same time, GPT-4 and Gemini Advanced are very close to each other in terms of capability, why is this? Can Google not do better? Are GPT-4 and Gemini Advanced pushing the limits of what''s possible with LLMs? Or did Google just train Gemini until it was "as good as GPT-4" and then they stopped? I don''t know.','2024-02-11');
INSERT INTO forecast_points VALUES(457,123,0.5500000000000000444,0.69999999999999995559,0.4000000000000000222,'KI project a slightly positive GDP growth in 2024, but I''m not as optimistic based on a stronger SEK and higher unemployment which shoulowth negatively. Still, I think uncertainty is high and I''m looking forward to rate cuts to see how the rest of the year will look.','2024-02-11');
INSERT INTO forecast_points VALUES(458,124,0.4500000000000000111,0.69999999999999995559,0.2000000000000000111,'There are three meetings and subsequent announcements before July. Most of the probability mass comes from the June meeting where CPI might have gotten under control and I think it is quite likely that ECB and the FED have cut rates by then, increasing the pressure on Riksbanken. However, I keep being pessimistic on SE CPI. I will update hard on coming meetings and CPI readings.','2024-02-12');
INSERT INTO forecast_points VALUES(459,125,0.75,0.9000000000000000222,0.5,'By the end of the year it is likely that both the Fed and ECB have cut rates at least once, increasing the pressure on Riksbanken to follow suit. Higher unemployment will also increase the pressure to cut rates.','2024-02-12');
INSERT INTO forecast_points VALUES(460,131,0.2000000000000000111,0.5,0.050000000000000002775,'Given my belief that rates stay higher for longer, I don''t think this is likely to happen. Forecasts from KI also predict a 8.5% unemployment rate at EOY. My own point forecast is closer to 8.7-8.9%.','2024-02-12');
INSERT INTO forecast_points VALUES(461,132,0.6500000000000000222,0.8000000000000000444,0.4500000000000000111,'Current sqm price is at ~102K SEK, which makes already close. Proposals from government as well as expectations of lower rates will likely lead toa yes resolution, but uncertainty is high and I''m not very experienced in thinking about the housing market. ','2024-02-12');
INSERT INTO forecast_points VALUES(462,126,0.75,0.9000000000000000222,0.5,'CPI inflation is declining, and even though I suspect it will be stickier than the market expects, I still believe that CPI will be below 3% before year end. ','2024-02-12');
INSERT INTO forecast_points VALUES(463,115,0.6500000000000000222,0.8000000000000000444,0.4000000000000000222,'Based on previous indications, this is likely to happen. 65% might even be a bit conservative on my end, I''m keeing it like this though due to ccontinued strenght in the US job market. ','2024-02-12');
INSERT INTO forecast_points VALUES(464,126,0.69999999999999995559,0.8000000000000000444,0.59999999999999997779,'January reading of CPI was higher than expected, mostly due to energy prices, but there was also an underlying rebalancing of the basket used for CPI calculations which affects the numbers positively. ','2024-02-21');
INSERT INTO forecast_points VALUES(465,154,0.10000000000000000555,0.010000000000000000208,0.29999999999999998889,'US CPI inflation is already at close to 3% and inflation expectations are in line with lower inflation ahead. Unless rate cuts have a large and quick negative effect, this is unlikely.','2024-02-21');
INSERT INTO forecast_points VALUES(466,125,0.86999999999999999555,0.94999999999999995559,0.6500000000000000222,'I was too pessimistic last time, all communication point towards at least one rate cut this year. And the FED and ECB are also very likely going to cut, which would increase the pressure on Sweden to do the same.','2024-02-21');
INSERT INTO forecast_points VALUES(467,116,0.9000000000000000222,0.6500000000000000222,0.98999999999999999111,'Short of anything incredible happening to inflation, at least one rate cut is going to happen in 2024. Perhaps the more interesting question would be when the third rate consecutive rate cut happens, in 2024 or 2025?','2024-02-21');
INSERT INTO forecast_points VALUES(468,120,0.25,0.5,0.10000000000000000555,'Data from 538 shows that RFK has been polling an average of 12.25% the past 5 months. However, he''s trending negatively (~10% in Feb) and I think polls are likely to overestimate independent candidates. I''m still very uncertain here and we are far from the election, so I''ll be wy of additional data.','2024-02-21');
INSERT INTO forecast_points VALUES(469,121,0.75,0.84999999999999997779,0.5,'Data from 538 shows that RFK has been polling an average of 12.25% in the past 5 months. This will likely come down, but he has solid support and therefore I think this has a high chance of happening. ','2024-02-21');
INSERT INTO forecast_points VALUES(470,134,0.4000000000000000222,0.59999999999999997779,0.10000000000000000555,'Sunak has a very slim chance to win the coming general election. All the polls show Labour leading and winning, but the general election technically does not have to be called before the end of January 2025. Given the losing position, most of my probability mass comes from Sunak not calling the election until 2025.','2024-02-21');
INSERT INTO forecast_points VALUES(471,135,0.75,0.9000000000000000222,0.59999999999999997779,'Hungary is the only remaining hurdle and even though they are giving Sweden and the rest of NATO a hard time currently, it seems like it is going to happen anytime now.','2024-02-21');
INSERT INTO forecast_points VALUES(472,136,0.94999999999999995559,0.98999999999999999111,0.8000000000000000444,'Only Hungary remains, and given that Turkey was convinced in less than a year, Hungary should not be a huge blocker. Remember, other NATO countries have quite some leverage even if Sweden might not have as much.','2024-02-21');
INSERT INTO forecast_points VALUES(473,141,0.085000000000000006106,0.10000000000000000555,0.050000000000000002775,'The probability of dying at age 81 is around 7.2% in the US, this is the base rate. We have to adjust this upwards based on a small chance that Biden is forced out by the Democratic party.','2024-02-21');
INSERT INTO forecast_points VALUES(474,150,0.4000000000000000222,0.69999999999999995559,0.2000000000000000111,'The probability mass comes from some different scenarios. 1) If the war between Israel and Hamas continues throughout 2024, then I think there''s a 5-15% chance that Netanyahu is removed from office, 2) if the war ends, then I think there''s a high (70-90%) chance that he''s removed from office. So then the question is; when will the war end? This is very difficult, made even more so by Netanyahu having an incentive to prolong the conflict. I think the war is 50-60% likely to end before 2025. Weighting the scenarios with the war-end probability, we get an estimate of around 40%.','2024-02-21');
INSERT INTO forecast_points VALUES(475,135,0.9000000000000000222,0.98999999999999999111,0.8000000000000000444,'Orban''s party is now reportedly voting on the ratification of Sweden''s NATO membership on Monday 26th of February. It seems unlikely that they will say anything else than YES. ','2024-02-22');
INSERT INTO forecast_points VALUES(476,136,0.97999999999999998223,0.99899999999999999911,0.9000000000000000222,'Orban''s party is planning to vote on Sweden''s membership application on Monday 26th of February, and it is very likely that they will say YES. Small chance that they stall further, but no reason to believe that they will be able to stall until the end of the year.','2024-02-22');
INSERT INTO forecast_points VALUES(477,152,0.25,0.4000000000000000222,0.10000000000000000555,'10 shutdowns have happened since 1980, giving a base rate of 22%. I''m rounding to 25%, given last year''s close call. I''m also willing to update hard on any coming evidence showing that a shutdown is more likely, since I believe that evidence in the opposite direction is more likely.','2024-02-23');
INSERT INTO forecast_points VALUES(478,130,0.59999999999999997779,0.8000000000000000444,0.4000000000000000222,'Based on the current state of the conflict and the mounting pressure on Israel from important nations such as the US and UK, it seems like most parties want a quick end to this. But Hamas and Israel have given no indication to be willing to compromise. I''m also being cautious based on my early Ukraine-Russia forecasts, where I thought the conflict would end much sooner.','2024-02-23');
INSERT INTO forecast_points VALUES(479,153,0.029999999999999998889,0.10000000000000000555,0.010000000000000000208,'Despite importants advertisers leaving X, the headcount cut has seemed to deal with the issue. X is also important enough for many, that I find it unlikely that Musk would have a hard time finding additional financing if needed.','2024-02-23');
INSERT INTO forecast_points VALUES(480,135,0.98999999999999999111,0.99899999999999999911,0.9000000000000000222,'The Hungarian parliament has ratified Sweden''s membership in NATO, making it all but a formality before Sweden joins NATO.','2024-02-26');
INSERT INTO forecast_points VALUES(481,136,0.99899999999999999911,0.99899999999999999911,0.99899999999999999911,'The Hungarian parliament has ratified Sweden''s NATO membership, now NATO just needs to release a statement.','2024-02-26');
INSERT INTO forecast_points VALUES(482,148,0.10000000000000000555,0.25,0.010000000000000000208,'Last year, I predicted ~20% chance of a cease-fire. In hindsight, that was probably too high. This year, nothing has changed really. The rest of the world slowly becomes tired of the war, which will undermine the Ukrainian war effort. But it seems unlikely given the current state that Ukraine enters any deal for peace or cease-fire.','2024-02-27');
INSERT INTO forecast_points VALUES(483,149,0.080000000000000001665,0.2000000000000000111,0.010000000000000000208,'China has been aggressive the past years, in both retoric and actual military moves. Still, the risks for China to invade Taiwan are too great for them to actually follow through. ','2024-02-27');
INSERT INTO forecast_points VALUES(484,144,0.29999999999999998889,0.5,0.10000000000000000555,'Based on Bahrain GP, Red Bull still has a comfortable advantage in race pace compared to other teams. Perez was able to comfortably go from 5th to 2nd and then manage pace until the end. Due to this, a small update is warranted.','2024-03-04');
INSERT INTO forecast_points VALUES(485,37,0.020000000000000000416,0.080000000000000001665,0.0010000000000000000208,'This forecast was inspired by a Volvo Cars executive saying that the goal and forecast was to sell 1.2M cars in 2025. I thought this was very unlikely, it still is. But with the global economy improving and the US market going strong for Volvo Cars, I''ll have to admit that I was being too uncharitable in my first forecast. Still, a growth rate higher than 30% is needed in both 2024 and 2025 to hit the target. This is unlikely but weirder things have happened.','2024-03-04');
INSERT INTO forecast_points VALUES(486,15,0.020000000000000000416,0.080000000000000001665,0.005000000000000000104,'Trump will be the GOP nominee (98% probability) and DeSantis has withdrawn from the race, thus 2% is the mass that is left.','2024-03-04');
INSERT INTO forecast_points VALUES(487,138,0.14999999999999999444,0.2000000000000000111,0.10000000000000000555,'The pre-season is not going well, Division 4 teams are much better than what we are used to. On the other hand, we have not yet started practicing anything else than futsal.','2024-03-04');
INSERT INTO forecast_points VALUES(488,110,0.2000000000000000111,0.4000000000000000222,0.050000000000000002775,'I''ve been way too optimistic on my ability to prioritize running and how fun it is to run in Swedish winter weather. I''ll have to run a lot in summer to make up for this optimism.','2024-03-04');
INSERT INTO forecast_points VALUES(489,137,0.5,0.59999999999999997779,0.4000000000000000222,'I do in fact regret my previous forecast, I should''ve been more conservative. Currently, we are not doing well at all (two losses with more than 4 goals conceded in each game). We still have time to improve, and more importantly, we are now going to start practicing outside rather than only doing futsal.','2024-03-04');
INSERT INTO forecast_points VALUES(490,112,0.8000000000000000444,0.9000000000000000222,0.59999999999999997779,'Since last update, the price of BTC has climbed up to above 62K USD. Though volatility still permits a decline below 50K, it  getting less likely by the day.','2024-03-05');
INSERT INTO forecast_points VALUES(491,10,0.40,0.70,0.30,'BTC has already increased by >50% this year. Another ~50% increase is needed to reach $100K. Seems like price pressure comes from increased institutional buying, hopes of lower rates, and maybe some hedge against political volatility. These factors can lead to further price pressure.','2024-03-06'); 
