-- PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE forecasts (id SERIAL PRIMARY KEY, question TEXT, 
                short_question TEXT, category TEXT, creation_date TIMESTAMP, resolution_criteria TEXT);
CREATE TABLE forecast_points (update_id SERIAL PRIMARY KEY, forecast_id INTEGER,
                point_forecast NUMERIC(10,4), upper_ci DOUBLE PRECISION, lower_ci DOUBLE PRECISION, reason TEXT, date_added TIMESTAMP, 
                FOREIGN KEY(forecast_id) REFERENCES forecasts(id));
CREATE TABLE resolutions (id SERIAL PRIMARY KEY, forecast_id INTEGER,
               resolution TEXT, resolution_date Timestamp, brier_score NUMERIC(10,4), 
               logn_score NUMERIC(10,4), log2_score NUMERIC(10,4), 
                FOREIGN KEY(forecast_id) REFERENCES forecasts(id));

COMMIT;